import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/emotionsDiary.css';

function EmotionsDiary() {
  const navigate = useNavigate();
  const [timeMachineResult, setTimeMachineResult] = useState(null);
  const [rating, setRating] = useState(null);
  const [loading, setLoading] = useState(true);

  // Recupera el token y, si no existe, redirige a login
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/');
      return;
    }
    // Obtener los resultados de Máquina del Tiempo
    axios.get('http://localhost:5000/api/game', {
      headers: { 'x-auth-token': token }
    })
      .then(response => {
        // Se asume que el endpoint devuelve un array ordenado por createdAt descendente
        if (response.data.length > 0) {
          // Tomamos el más reciente
          setTimeMachineResult(response.data[0]);
        }
        setLoading(false);
      })
      .catch(err => {
        console.error(err);
        setLoading(false);
      });
  }, [navigate]);

  const handleRatingClick = (level) => {
    setRating(level);
  };

  const handleSave = async () => {
    if (!timeMachineResult || !rating) {
      alert('Por favor, selecciona un nivel de emoción.');
      return;
    }
    const token = localStorage.getItem('token');
    try {
      await axios.post('http://localhost:5000/api/emotions', {
        timeMachineResultId: timeMachineResult._id,
        rating: rating
      }, {
        headers: { 'x-auth-token': token }
      });
      alert('¡Diario de emociones guardado!');
      navigate('/dashboard');
    } catch (err) {
      console.error(err);
      alert('Error al guardar el diario de emociones.');
    }
  };

  if (loading) return <div>Cargando...</div>;
  if (!timeMachineResult) return <div>No hay datos registrados de la Máquina del Tiempo para calificar.</div>;

  // Se combinan todas las actividades de los distintos slots en un único array
  const activities = timeMachineResult.timeSlots.reduce((acc, slot) => acc.concat(slot.activities), []);

  return (
    <div className="emotions-diary-container">
      <header className="top-bar">
        <div className="left-section">
          <button className="back-dashboard-btn" onClick={() => navigate('/dashboard')}>←</button>
          <i className="fa fa-user-circle user-icon" aria-hidden="true"></i>
        </div>
        <div className="center-section">
          <h1 className="title">Diario de emociones</h1>
        </div>
        <div className="right-section">
          {/* Puedes incluir aquí otros botones si lo deseas */}
        </div>
      </header>

      <main className="emotions-main">
        <section className="activities-section">
          <h2>Mis Actividades</h2>
          <div className="activities-container">
            {activities.map((act, index) => (
              <div key={index} className="activity-card">
                <span className="activity-icon">{act.icon}</span>
                <span className="activity-title">{act.title}</span>
              </div>
            ))}
          </div>
        </section>
        <section className="emotion-section">
          <h2>¿Cómo te sientes con lo bien que haces estas actividades?</h2>
          <div className="thermometer">
            <button className={`emotion-btn ${rating === 5 ? 'selected' : ''}`} onClick={() => handleRatingClick(5)}>😄 Muy feliz</button>
            <button className={`emotion-btn ${rating === 4 ? 'selected' : ''}`} onClick={() => handleRatingClick(4)}>😊 Feliz</button>
            <button className={`emotion-btn ${rating === 3 ? 'selected' : ''}`} onClick={() => handleRatingClick(3)}>😐 Neutral</button>
            <button className={`emotion-btn ${rating === 2 ? 'selected' : ''}`} onClick={() => handleRatingClick(2)}>☹️ Poco feliz</button>
            <button className={`emotion-btn ${rating === 1 ? 'selected' : ''}`} onClick={() => handleRatingClick(1)}>😢 Nada feliz</button>
          </div>
          <button className="save-emotion-btn" onClick={handleSave}>Guardar</button>
        </section>
      </main>

      <footer className="footer-bar">
        <p>2025 © Iván Vela Campos</p>
      </footer>
    </div>
  );
}

export default EmotionsDiary;
